/* global inpageBundle */

/**
 * Injects a script tag into the current document
 *
 * @param {string} content - Code to be executed in the current document
 */
function injectScript(content) {
  try {

    const container = document.head || document.documentElement

    // synchronously execute script in page context
    const scriptTag = document.createElement('script')
    scriptTag.setAttribute('async', false)
    scriptTag.textContent = content
    container.insertBefore(scriptTag, container.children[0])

    // script executed; remove script element from DOM
    container.removeChild(scriptTag)
  } catch (err) {
    console.error('ezDefi script injection failed', err)
  }
}

/**
 * Determines if Web3 should be injected
 *
 * @returns {boolean} {@code true} if Web3 should be injected
 */
function shouldInjectWeb3() {
  return doctypeCheck() && suffixCheck() &&
    documentElementCheck() && !blacklistedDomainCheck()
}

/**
 * Checks the doctype of the current document if it exists
 *
 * @returns {boolean} {@code true} if the doctype is html or if none exists
 */
function doctypeCheck() {
  const doctype = window.document.doctype
  if (doctype) {
    return doctype.name === 'html'
  } else {
    return true
  }
}

/**
 * Returns whether or not the extension (suffix) of the current document is prohibited
 *
 * This checks {@code window.location.pathname} against a set of file extensions
 * that should not have web3 injected into them. This check is indifferent of query parameters
 * in the location.
 *
 * @returns {boolean} whether or not the extension of the current document is prohibited
 */
function suffixCheck() {
  const prohibitedTypes = [
    /\\.xml$/,
    /\\.pdf$/,
  ]
  const currentUrl = window.location.pathname
  for (let i = 0; i < prohibitedTypes.length; i++) {
    if (prohibitedTypes[i].test(currentUrl)) {
      return false
    }
  }
  return true
}

/**
 * Checks the documentElement of the current document
 *
 * @returns {boolean} {@code true} if the documentElement is an html node or if none exists
 */
function documentElementCheck() {
  const documentElement = document.documentElement.nodeName
  if (documentElement) {
    return documentElement.toLowerCase() === 'html'
  }
  return true
}

/**
 * Checks if the current domain is blacklisted
 *
 * @returns {boolean} {@code true} if the current domain is blacklisted
 */
function blacklistedDomainCheck() {
  const blacklistedDomains = [
    'uscourts.gov',
    'dropbox.com',
    'webbyawards.com',
    'cdn.shopify.com/s/javascripts/tricorder/xtld-read-only-frame.html',
    'adyen.com',
    'gravityforms.com',
    'harbourair.com',
    'ani.gamer.com.tw',
    'blueskybooking.com',
    'sharefile.com',
  ]
  const currentUrl = window.location.href
  let currentRegex
  for (let i = 0; i < blacklistedDomains.length; i++) {
    const blacklistedDomain = blacklistedDomains[i].replace('.', '\\.')
    currentRegex = new RegExp('(?:https?:\\/\\/)(?:(?!' + blacklistedDomain + ').)*$')
    if (!currentRegex.test(currentUrl)) {
      return true
    }
  }
  return false
}

/**
 * Returns a promise that resolves when the DOM is loaded (does not wait for images to load)
 */
async function domIsReady() {
  // already loaded
  if (['interactive', 'complete'].includes(document.readyState)) {
    return
  }
  // wait for load
  await new Promise(resolve => window.addEventListener('DOMContentLoaded', resolve, { once: true }))
}

/**
 * Sets up the stream communication and submits site metadata
 *
 */
async function start() {
  await domIsReady()
  window.setupStreams()
}

if (shouldInjectWeb3()) {
  injectScript(inpageBundle);
  try {
    if (SOLANA) {
      injectScript(SOLANA);
    }
  } catch (error) {
    console.log("error", error)
  }
  start()
  if (window !== top) {
    window.ReactNativeWebView && window.ReactNativeWebView.postMessage(JSON.stringify(
      {
        type: 'FRAME_READY',
        payload: {
          url: window.location.href,
        },
      },
    ))

    window.addEventListener('message', message => {
      console.log("message publicConfig", message)
      if (message.data.name === 'publicConfig') {

        // Manual update for Iframes
        const { data } = message.data

        if (
          data.isUnlocked !== window.ethereum.isUnlocked ||
          data.isEnabled !== window.ethereum.isEnabled ||
          data.selectedAddress !== window.ethereum.selectedAddress ||
          data.networkVersion !== window.ethereum.networkVersion ||
          data.networkVersion !== window.ethereum.networkVersion ||
          data.chainId !== window.ethereum.chainId
        ) {
          window.ethereum._publicConfigStore.emit('update', message.data.data)
        }
      }
    })
  }
}
